const fs = require('fs');
var axios = require('axios');

const getResult = (item, index) => {
    return new Promise((resolve) => {
        var config = {
            method: 'get',
            url: item,
            headers: { }
        };
        
        axios(config)
            .then(function (response) {
                // console.log(index, item);
                resolve(JSON.stringify(response.data));
            })
            .catch(function (error) {
                console.log(error);
                resolve("[error]");
            });
    });
};

const waitForSec = (seconds) => {
    return new Promise((resolve) => {
        setTimeout(() => {
            resolve(true);
        }, seconds * 1000);
    });
};

